import { GetHomeByData } from '@/api/home'

export default {
  name: 'Index',
  data() {
    return {
      statistical: {
        order: 0,
        Demand: 0
      },
      order:[],
    }
  },
  created() {
    this.getdata()
  },
  methods: {
    getdata() {
      GetHomeByData().then(res => {
        this.statistical = res.data.statistical
        this.order = res.data.order
      })
    }
  }
}
